import { Card, CardFooter, Image } from "@nextui-org/react";

export function SkillCard({ path, number, title }) {
  return (
    <Card className="w-1/2 sm:w-2/5 md:w-3/10 lg:w-1/4 mx-auto md:mx-0">
      <Image
        removeWrapper
        alt="Card background"
        className="z-0 w-full h-full object-cover brightness-50"
        src={path} />
      <CardFooter className="absolute z-10 bottom-0 flex-col !items-start">
        <p className="text-tiny text-white/60 uppercase font-bold">{number}</p>
        <h4 className="text-white font-medium text-large">{title}</h4>
      </CardFooter>
    </Card>
  );
}

export default function NextCard({title, subtitle, image, page}) {
  return (
      <Card className="h-[250px] sm:h-[250px] md:h-[300px] lg:h-[350px] xl:h-[400px] w-[180px] sm:w-[180px] md:w-[220px] lg:w-[250px] xl:w-[300px]] mx-auto md:mx-0">
          <CardHeader className="absolute z-10 top-1 flex-col !items-start">
              <p className="text-tiny text-white/60 uppercase font-bold">{subtitle}</p>
              <h4 className="text-white font-medium text-large">{title}</h4>
          </CardHeader>
          <Image
              removeWrapper
              alt="Card background"
              className="z-0 w-full h-full object-cover brightness-50"
              src={image}
          />
          {page ? <CardFooter className="justify-between before:bg-white/10 border-white/20 border-1 overflow-hidden py-1 absolute before:rounded-xl rounded-large bottom-1 w-[calc(100%_-_8px)] shadow-small ml-1 z-10">
              <p className="text-tiny text-white/80">Read More</p>
              <Link to={page} >
              <Button isIconOnly className="bg-transparent text-white">
                  {RightArrow}
              </Button>
              </Link>
          </CardFooter> : ''}
      </Card>
  )
}
